components.customConditional:
show =!data.denyProgramInformationRequest && (
  // While the PIR is being completed by the user.
  (data.pirStatus === "Required" && !data.showCustomOffering)
  // Or when it was completed in some way with a public offering.
  || (data.pirStatus !== "Required" && data.offeringType === "Public"));

validate.custom:
// To calculate the time difference of two dates
const Difference_In_Time = new Date(data.studyEndDate).getTime() - new Date(data.studyStartDate).getTime();
 
// To calculate the no. of days between two dates
const Difference_In_Days = Difference_In_Time / (1000 * 3600 * 24);
valid = (data.studyStartDate) ? 
  ((Difference_In_Days >= 42) && (Difference_In_Days <= 365)) ? 
  true : "Invalid Study Period, Dates must be between 42 and 365 days" : 
"Please provide Study Start date";
